aceOfNullableDateTimeProperty", "ReadOnlyListInterfaceOfNullableModelEnumProperty", "ReadOnlyListInterfaceOfNullableModelFlagsEnumProperty", "ReadOnlyDictionaryInterfaceOfBoolProperty", "ReadOnlyDictionaryInterfaceOfIntProperty", "ReadOnlyDictionaryInterfaceOfStringProperty", "ReadOnlyDictionaryInterfaceOfGuidProperty", "ReadOnlyDictionaryInterfaceOfModelEnumProperty", "ReadOnlyDictionaryInterfaceOfModelFlagsEnumProperty", "ReadOnlyDictionaryInterfaceOfModelClassProperty", "ReadOnlyDictionaryInterfaceOfNullableBoolProperty", "ReadOnlyDictionaryInterfaceOfNullableIntProperty", "ReadOnlyDictionaryInterfaceOfNullableGuidProperty", "ReadOnlyDictionaryInterfaceOfNullableModelEnumProperty", "ReadOnlyDictionaryInterfaceOfNullableModelFlagsEnumProperty", "CollectionInterfaceOfStringProperty", "CollectionOfCollectionInterfaceOfStringProperty", "ListInterfaceOfCollectionInterfaceOfStringProperty", "ListOfCollectionInterfaceOfStringProperty", "ReadOnlyCollectionOfCollectionInterfaceOfStringProperty", "DictionaryInterfaceOfReadOnlyListInterfaceOfDateTimeProperty", "DictionaryOfReadOnlyListInterfaceOfDateTimeProperty", "ReadOnlyDictionaryOfReadOnlyListInterfaceOfDateTimeProperty", "ConcurrentDictionaryOfReadOnlyListInterfaceOfDateTimeProperty", "ReadOnlyListInterfaceOfReadOnlyDictionaryInterfaceOfReadOnlyListInterfaceOfDateTimeProperty", "ReadOnlyDictionaryInterfaceOfReadOnlyDictionaryInterfaceOfReadOnlyDictionaryOfReadOnlyListInterfaceOfDateTimeProperty" };

                var scenarios = DeepCloneWithTestScenarios.ValidateAndPrepareForTesting();

                var obcAssertionAsTestMethod = typeof(WorkflowExtensions).GetMethod(nameof(WorkflowExtensions.AsTest));

                var obcAssertionBeEqualToMethod = typeof(Verifications).GetMethod(nameof(Verifications.BeEqualTo));

                foreach (var scenario in scenarios)
                {
                    // Arrange
                    if (scenario.WithPropertyName == DeepCloneWithTestScenario.ForceGeneratedTestsToPassAndWriteMyOwnScenarioPropertyName)
                    {
                        continue;
